import React from "react";

import classes from "./FollowingsSection.module.css";
import TwitterAccount from "./TwitterAccount";
import AddTwitter from "./AddTwitter";
import SectionWrapper from "../Layout/SectionWrapper";
import SectionHeader from "../Layout/SectionHeader";

const FollowingsSection = () => {
  return (
    <SectionWrapper>
      <SectionHeader title="My followings" />
      <ul className={classes.followings}>
        <TwitterAccount />
        <TwitterAccount />
        <TwitterAccount />
      </ul>
      <AddTwitter />
    </SectionWrapper>
  );
};

export default FollowingsSection;
